import React, { Component } from 'react';
import authService from '../services/auth.service';
import './WebScrapping.css';
import {toast} from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
toast.configure()

class ListEmployeeComponent extends Component {

    constructor(props){
        super(props)
        this.state={
            employees: [],
        }   
    }

componentDidMount(){
    authService.videoWebscraping().then((res) => {
          this.setState({employees:res.data});
    });
 
}

notify (){
 
    // Calling toast method by passing string
    toast(this.state.message)
}

DeleteUser(id){
    authService.deleteUser(id).then(
        
        response => {
          this.setState({
            message: response.data.message,
            successful: true
          });
          authService.getUsers().then((res) => {
            this.setState({employees:res.data});
      });
        this.notify();
        },
        error => {
          const resMessage =
            (error.response &&
              error.response.data &&
              error.response.data.message) ||
            error.message ||
            error.toString();
            

          this.setState({
            successful: false,
            message: resMessage
          });
          this.notify();
        }
        
      );
}

    render() {
        return (
            <div>
               <h2 id="headerTitle1">User List</h2> 
            <br></br>
               <div className="rowV">
                   <table >
                       <thead>
                           <tr>
                               <th>Video Name</th>
                               <th>Author</th>
                               <th>Year</th>
                               <th>Duration</th>
                               <th>Category</th>
                               <th>Description</th>
                               <th>Image</th>
                           </tr>
                           
                       </thead>
                       <tbody>
                           {
                               this.state.employees.map(
                                   employee =>
                                   <tr key={employee.id}>
                                       <td className='back1'>{employee.name}</td>
                                       <td className='back1'>{employee.author}</td>
                                       <td className='back1'>{employee.year}</td>
                                       <td className='back1'>{employee.duration}</td>
                                       <td className='back1'>{employee.category}{employee.image}</td>
                                       
                                       <td className='back1'>{employee.description}</td>
                                       
                                       <td className='back1'><img src={employee.image} className='viewAllImage'></img></td>
                                      
                                       
                                   </tr>
                               )
                           }
                       </tbody>
                   </table>

               </div>
            </div>
        );
    }
}

export default ListEmployeeComponent;
